import React from 'react';

function Login() {
    return (
        <div>
            <body>
                <div>
                    <p>아이디</p>
                    <input type="text" id="id" name="id" />
                </div>
                <div>
                    <p>비밀번호</p>
                    <input type="password" id="password" name="password" />
                </div>
                <div>
                    <button>로그인</button>
                </div>
            </body>
        </div>
    );
}

export default Login;
